import React, { Component } from 'react';
import Navigation from './Navigation';
import party from '../assets/party.png';
class Events extends Component {
    render() {
        return (
            <div>
                <Navigation />
                <img id="party" src={party}/>
            </div>
        );
    }
}

export default Events;
